import {Box, Stack, Typography} from '@mui/material'

const Header = () => {
  return (
    <Stack
        direction='row' alignItems='center' justifyContent='center' p={2}
        sx={{position: 'sticky', backgroundColor: 'white'}}
    >
        <Typography>
            Notes
        </Typography>
    </Stack>
  )
}

export default Header
